import { newE2EPage } from '@stencil/core/testing';
describe('hmc-banner-message', () => {
  it('renders', async () => {
    const page = await newE2EPage();
    await page.setContent('<hmc-banner-message></hmc-banner-message>');
    const element = await page.find('hmc-banner-message');
    expect(element).toHaveClass('hydrated');
  });
});
